<div style="background-color: green; color: yellow; padding: 1rem; font-size: 2rem; line-height: 3rem;">

<p style="line-height: 3rem;">
Un INFORMATICO \xE8 una persona che ha una profonda passione per la tecnologia e soprattutto per i computer. Usa il computer, in ogni aspetto delle sue attivit\xE0 e ne trae gioia e felicit\xE0.
<b>Quando usa il compuer si diverte e il lavoro e lo studio sembrano un gioco e non uno sforzo.</b>

Ama smanettare e risolvere qualsiasi problema con il computer   

</p>
</div>
